import { IProduct } from "../../types";

export const ProductsTable = ({ product }: { product: IProduct }) => {
  console.log(product.category.name)
  return (
    <tr>
      <th>{product._id}</th>
      <th>{product.name}</th>
      <th>{product.category.name}</th>
      <th>{product.price}</th>
      <th>{product.amount}</th>
      <th>{product.image}</th>
    </tr>
  );
};
